  REnode* Parer::RetNode(std::vector<RuneClass> &vecR){
    REnode* REnodeUNION = Re.initREnode(Kind::REGEXP_UNION, {0, 0});
    for (auto it : LBlock){
        RuneSequence RS;
        Re.ConvertToUTF_8(it.min, it.max, RS);
        for (auto itc : RS){
          REnodeUNION->Children.emplace_back(itc);
      }
    }
    return REnodeUNION;
  }

  REnode* Parer::LargeUnicodeBlock2Node(std::wstring &str){
    std::string Pclass;
    if (str[0] == '\\' && str[1] == 'p')
      str.erase(0, 3);  
    else
      return nullptr;
    while (str[0] != '}'){
      Pclass.push_back(str[0]);
      str.erase(0,1);
    }
    str.erase(0,1);
    if (Pclass == "L"){
      return RetNode(LBlock);
    }
    if (Pclass == "Lu"){
      return RetNode(LuBlock);
    }
    if (Pclass == "Ll"){
      return RetNode(LlBlock);
    }
    if (Pclass == "Pc"){
      return RetNode(PcBlock);
    }
    if (Pclass == "Nd"){
      return RetNode(NdBlock);
    }
    if (Pclass == "Mn"){
      return RetNode(MnBlock);
    }
    if (Pclass == "Sc"){
      return RetNode(ScBlock);
    }
    return nullptr;
  }
